        // reserve space
        c_gclicmdf_Reserve(gclicmdc, 1);
        u32 n  = gclicmdc.c_gclicmdf_n;
        u32 at = n;
        gcli::FGclicmdf* *elems = gclicmdc.c_gclicmdf_elems;
